			title={props.array[2].title}
			price={props.array[2].price}
			date={props.array[2].date}/>
		<ExpensesElements
			title={props.array[3].title}
			price={props.array[3].price}
			date={props.array[3].date}
		/>
	</div>

    )
}


export default ExpenseItems
